import React from "react";
import logo from "../assets/images.png"; // 确保 images.png 已放在 src/assets 文件夹中
import { useNavigate } from "react-router-dom";

const Manager = () => {
  const navigate = useNavigate();

  const handleNavigate = (path) => {
    navigate(path);
  };

  return (
    <div style={{ padding: "30px", textAlign: "center" }}>
      <img src={logo} alt="Logo" style={{ maxWidth: "200px", marginBottom: "20px" }} />
      <h2>Manager Page</h2>

      <div style={{ display: "grid", gridTemplateColumns: "1fr 1fr", gap: "10px", maxWidth: "400px", margin: "20px auto" }}>
        <button onClick={() => handleNavigate("/drink-menu")}>Drink Menu</button>
        <button onClick={() => handleNavigate("/inventory")}>Inventory</button>
        <button onClick={() => handleNavigate("/trends")}>Trends</button>
        <button onClick={() => handleNavigate("/employee")}>Employee</button>
        <button onClick={() => handleNavigate("/orders")}>Orders</button>
        <button onClick={() => handleNavigate("/add-seasonal")}>Add Seasonal Menu Item</button>
        <button onClick={() => handleNavigate("/product-usage")}>Product Usage</button>
        <button onClick={() => handleNavigate("/x-report")}>X-Report</button>
        <button onClick={() => handleNavigate("/z-report")}>Z-Report</button>
        <button onClick={() => handleNavigate("/")}>Logout</button>
      </div>
    </div>
  );
};

export default Manager;
